      SELECT DISTINCT ( cor0.col1 ) + 84 * + 64 AS col1 FROM tab0 (FORMAT parquet), tab2 (FORMAT parquet) AS cor0, tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q11652.out
    data: |
      5393
      5407
      5435
